import React from "react";
import './Footer.css'
import home from '../assets/homeicon.svg'
import exit from '../assets/exitacc.svg'
import history from '../assets/history.svg'
function Footer() {
    return (
        <div className={'nav-bar'} style={{
        }}>
            <button><img className={'icons-menu'} src={home} alt={'home'}/></button>
            <button>2</button>
            <button><img className={'icons-menu'} src={history} alt={'home'}/></button>
            <button><img className={'icons-menu'} src={exit} alt={'home'}/></button>
        </div>
    )

}
export default Footer;
